import React from 'react';
import styled from 'styled-components';

const BtnContainer = styled.div`
  position: absolute;
  right: 0;
  background: black;
  width: 3rem;
  height: 8rem;
`;

function TimerBtn({ onClick }) {
  return <BtnContainer>Timer</BtnContainer>;
}

export default TimerBtn;
